    root : {

    }
}

const CustomDatePicker = ({ classes }) => {
    return <KeyboardDatePicker
    clearable
    // value={selectedDate}
    placeholder="10/10/2018"
    // onChange={date => handleDateChange(date)}
    minDate={new Date()}
    format="MM/dd/yyyy"
  />
}

